import React, { Component } from 'react'

export class addTodo extends Component {
    render() {
        return (
            <form style = {{display: 'flex'}}> 
                <input 
                    type = "text" 
                    name = "title" 
                    style ={{flex: '100px', padding: '5px'}}
                    placeholder = "Add Todo..."
                />
                <input 
                type="submit" 
                value = "Submit" 
                className ="btn"
                style = {{flex: '1'}}
                />
            </form>
        )
    }
}

export default addTodo
